function newResource(e){$.ajax({type:"POST",url:serverURL+"resource",data:e,success:function(e){window.localStorage.email=$("#email").val(),window.localStorage.auth_token=e.auth_token,window.location.href="dashboard.html"},error:function(e,o,r){console.log(e.status),console.log(r),window.alert("Stashing New Resource Failed")}})}var serverURL="https://project3pockety.herokuapp.com/";$(function(){$("#new-resource-form").on("submit",function(e){e.preventDefault();var o=$(this).serialize();newResource(o)})});